import { Link } from "react-router-dom";

export default function(){

    return(<>
    <div className="row" style={{backgroundColor:"rgb(54,69,79)",minHeight:"40px",paddingLeft:"70px"}}>
        <div className="col-xs-6 col-sm-4" style={{backgroundColor:"red",marginRight:"0px",padding:"10px",textAlign:"center"}}><Link to="/LatestMovies" style={{color:"white"}}>Latest Movies</Link></div>
        <div className="col-xs-6 col-sm-4" style={{backgroundColor:"red",padding:"10px",textAlign:"center"}}><Link to="/UpcomingMovies" style={{color:"white"}}>Upcoming Movies</Link></div>
        <div className="col-xs-6 col-sm-4" style={{padding:"10px",textAlign:"center"}}><Link to="/NearByEvents"  style={{color:"white"}}>Near By Event</Link></div>

    </div>
    </>)
}
